import ReactDOM from 'react-dom';
import React, { Component } from 'react';
import './index.css';

class Statement extends Component{
	constructor(props){
		super(props);
		this.state = {date: new Date()};
	}

  componentDidMount() {
  	 this.timerID = setInterval(
      () => this.tick(),
      1000
    );
  }

  componentWillUnmount() {
  	clearInterval(this.timerID);
  }

  tick() {
    this.setState({
      date: new Date()
    });
  }

	render(){
		return (
		<div>
		  <th key = '1' > props.currentVersion</th>
		  <th key = '2' > props.currentVersion</th>

		  </div>
			);
		}
}

class StatementTable extends Component{
	constructor(props){
		super(props);
		this.state = {statementList: [new Statement(), new Statement()]}
		// this.state = {statementList: ["john", "Jeff"]}
	}

	render() {
		return (
			<table>
			<tr>
			{(this.state.statementList || []).map(function(s, index){
				return {s} 
			})}
			</tr>
			</table>
			);
	}

}


ReactDOM.render(<StatementTable />, document.getElementById('root'));
